// src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

import PlayerPicksPage from './components/PlayerPicksPage';
import AdminUploadPage from './components/AdminUploadPage';
import ViewPicksPage from './components/ViewPicksPage';
import ViewScoresPage from './components/ViewScoresPage';
import ScoredPicksPage from './components/ScoredPicksPage';
import AdminWinnersPage from './components/AdminWinnersPage';
import PrintableGamesPage from './components/PrintableGamesPage';

function App() {
  return (
    <Router>
      <div className="p-4">
        <Routes>
          <Route path="/" element={<PlayerPicksPage />} />
          <Route path="/picks/week/:week" element={<PlayerPicksPage />} />
          <Route path="/admin" element={<AdminUploadPage />} />
          <Route path="/view-picks/:week" element={<ViewPicksPage />} />
          <Route path="/view-scores/:week" element={<ViewScoresPage />} />
          <Route path="/scored-picks/:week" element={<ScoredPicksPage />} />
          <Route path="/admin-winners/:week" element={<AdminWinnersPage />} />
          <Route path="/print/week/:week" element={<PrintableGamesPage />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
